using UnityEngine;
using System.Collections;
using System;

[ModTitle("Raft Center Beacon")]
[ModDescription("Auto load beacon the original center of your raft. Original by camarril")]
[ModAuthor("kju8")]
[ModIconUrl("https://raw.githubusercontent.com/kju8/FindRaftCenter/master/Thumbnail.png")]
[ModWallpaperUrl("https://raw.githubusercontent.com/kju8/FindRaftCenter/master/Banner.jpg")]
[ModVersionCheckUrl("https://raw.githubusercontent.com/kju8/FindRaftCenter/master/version.txt")]
[ModVersion("1.6")]
[RaftVersion("Update 11 (4677160)")]
[ModIsPermanent(false)]
public class FindRaftCenter : Mod
{
    AssetBundle assets;
    GameObject cylinderAsset;
    GameObject marker;

    public void Start()
    {
        assets = AssetBundle.LoadFromMemory(Convert.FromBase64String(embeddedAssetBundle.data));
        cylinderAsset = assets.LoadAsset<GameObject>("Cylinder");
    }
    
    public override void WorldEvent_WorldLoaded()
    {
        marker = Instantiate(cylinderAsset);
        marker.transform.localScale = new Vector3(0.15f, 20f, 0.15f);
        
        Raft raft = ComponentManager<Raft>.Value;
        if(raft != null){
            marker.transform.SetParent(raft.gameObject.transform, false);
            RConsole.Log("FindRaftCenter has been loaded!");
        }
    }

    public void Update()
    {
        if (Semih_Network.InLobbyScene || RAPI.GetLocalPlayer() == null || marker == null || marker.transform == null) { return; }
        
        float dist = Vector3.Distance(marker.transform.position, RAPI.GetLocalPlayer().transform.position);
        
        float size = Math.Max(0f, dist - 30f) * 0.01f + 0.15f;
        marker.transform.localScale = new Vector3(size, 20f, size);
        
        float power = Math.Min(Math.Max(Math.Abs(GetAngle(marker.transform.position)) / 60f, dist / 75f), 1f);
        float danger = Mathf.Clamp((dist - 50f) * 0.1f, 0.0f, 1.0f);
        
        Renderer markerRenderer = marker.GetComponent<Renderer>();
        if(markerRenderer == null || markerRenderer.material == null) { return; }
        markerRenderer.material.SetColor("_Color", new Color(1f,1f - danger,1f - danger,0.2f + power * 0.3f) );
        markerRenderer.material.EnableKeyword ("_EMISSION");
        markerRenderer.material.SetColor("_EmissionColor", new Color(1f,1f - danger,1f - danger,1f) * (0.3f + power * power * 1.2f) );
    }

    float GetAngle(Vector3 pos)
    {
        Vector2 playerPos = new Vector2(RAPI.GetLocalPlayer().transform.position.x, RAPI.GetLocalPlayer().transform.position.z);
        Vector2 playerFwd = new Vector2(RAPI.GetLocalPlayer().transform.forward.x, RAPI.GetLocalPlayer().transform.forward.z);
        float angle = Vector2.SignedAngle(new Vector2(pos.x, pos.z) - playerPos, playerFwd);
        return angle;
    }

    public void OnModUnload()
    {
        if(marker)
        {
            Destroy(marker);
        }
        if(assets)
        {
            assets.Unload(true);
        }
        RConsole.Log("FindRaftCenter has been unloaded!");
        Destroy(gameObject);
    }
}

public static class embeddedAssetBundle {
  public static string data = "";
}
